    p_out_Nt_unit=gamma_gcc_interpolateg_4(P_look_up_tables_pch_thermal_noise_ss_LUT,(midoutp_V-vdd_V),(outp_V-vdd_V),0,size_Lo,&p_out_dNt_dvgs,&p_out_dNt_dvds,&p_out_dNt_dvbs,&p_out_dNt_dl);
