    p_out_Nf=p_out_Nf_unit*p_out_go*p_out_go/(size_Wo*size_Lo);
    if (!isfinite(p_out_Nf))  {status_fail=6; return TCL_ERROR;}
    float current_transfer_p_1=Ted*((-((-p_2_gm*(-p_out_gm*((((nin_1_go+nin_1_gm)+nin_2_go)+nin_2_gm)+n_tail_go)*(n_ref_go+n_ref_gm)))-((-nin_2_go)-nin_2_gm)*p_out_gm*(-nin_1_go)*(n_ref_go+n_ref_gm))))/property_Adc;
    float current_transfer_p_2=Ted*((-((-((p_1_go+p_1_gm)+nin_1_go)*p_out_gm*((((nin_1_go+nin_1_gm)+nin_2_go)+nin_2_gm)+n_tail_go)*(n_ref_go+n_ref_gm))+((-nin_1_go)-nin_1_gm)*p_out_gm*(-nin_1_go)*(n_ref_go+n_ref_gm))))/property_Adc;
    float current_transfer_nin_1=Ted*((-((-p_2_gm*((-p_out_gm*((((nin_1_go+nin_1_gm)+nin_2_go)+nin_2_gm)+n_tail_go)*(n_ref_go+n_ref_gm))+((-nin_1_go)-nin_1_gm)*p_out_gm*(n_ref_go+n_ref_gm)))-((-nin_2_go)-nin_2_gm)*((-((p_1_go+p_1_gm)+nin_1_go)*p_out_gm*(n_ref_go+n_ref_gm))+p_out_gm*(-nin_1_go)*(n_ref_go+n_ref_gm)))))/property_Adc;
    float current_transfer_nin_2=Ted*((-(((-p_2_gm*((-nin_1_go)-nin_1_gm)*p_out_gm*(n_ref_go+n_ref_gm))+((-((p_1_go+p_1_gm)+nin_1_go)*p_out_gm*((((nin_1_go+nin_1_gm)+nin_2_go)+nin_2_gm)+n_tail_go)*(n_ref_go+n_ref_gm))+((-nin_1_go)-nin_1_gm)*p_out_gm*(-nin_1_go)*(n_ref_go+n_ref_gm)))-((-nin_2_go)-nin_2_gm)*(-((p_1_go+p_1_gm)+nin_1_go)*p_out_gm*(n_ref_go+n_ref_gm)))))/property_Adc;
    float current_transfer_n_tail=Ted*((-((-p_2_gm*((-nin_1_go)-nin_1_gm)*p_out_gm*(n_ref_go+n_ref_gm))-((-nin_2_go)-nin_2_gm)*(-((p_1_go+p_1_gm)+nin_1_go)*p_out_gm*(n_ref_go+n_ref_gm)))))/property_Adc;
    float current_transfer_n_ref=Ted*((-(((p_2_go+nin_2_go)*(((p_1_go+p_1_gm)+nin_1_go)*n_out_gm*(-((((nin_1_go+nin_1_gm)+nin_2_go)+nin_2_gm)+n_tail_go))+((-nin_1_go)-nin_1_gm)*n_out_gm*(-nin_1_go))-p_2_gm*((-nin_1_go)-nin_1_gm)*(p_out_gm*(-n_tail_gm)+n_out_gm*(-nin_2_go)))-((-nin_2_go)-nin_2_gm)*(-((p_1_go+p_1_gm)+nin_1_go)*(p_out_gm*(-n_tail_gm)+n_out_gm*(-nin_2_go))))))/property_Adc;
    float current_transfer_n_out=Ted*((-(((p_2_go+nin_2_go)*(((p_1_go+p_1_gm)+nin_1_go)*((((nin_1_go+nin_1_gm)+nin_2_go)+nin_2_gm)+n_tail_go)*(n_ref_go+n_ref_gm)+((-nin_1_go)-nin_1_gm)*(-(-nin_1_go)*(n_ref_go+n_ref_gm)))-p_2_gm*((-nin_1_go)-nin_1_gm)*(-(-nin_2_go)*(n_ref_go+n_ref_gm)))-((-nin_2_go)-nin_2_gm)*(-((p_1_go+p_1_gm)+nin_1_go)*(-(-nin_2_go)*(n_ref_go+n_ref_gm))))))/property_Adc;
    float current_transfer_p_out=Ted*((-(((p_2_go+nin_2_go)*(((p_1_go+p_1_gm)+nin_1_go)*((((nin_1_go+nin_1_gm)+nin_2_go)+nin_2_gm)+n_tail_go)*(n_ref_go+n_ref_gm)+((-nin_1_go)-nin_1_gm)*(-(-nin_1_go)*(n_ref_go+n_ref_gm)))-p_2_gm*((-nin_1_go)-nin_1_gm)*(-(-nin_2_go)*(n_ref_go+n_ref_gm)))-((-nin_2_go)-nin_2_gm)*(-((p_1_go+p_1_gm)+nin_1_go)*(-(-nin_2_go)*(n_ref_go+n_ref_gm))))))/property_Adc;
    property_Nt=(current_transfer_p_1*current_transfer_p_1*p_1_Nt+current_transfer_p_2*current_transfer_p_2*p_2_Nt+current_transfer_nin_1*current_transfer_nin_1*nin_1_Nt+current_transfer_nin_2*current_transfer_nin_2*nin_2_Nt+current_transfer_n_tail*current_transfer_n_tail*n_tail_Nt+current_transfer_n_ref*current_transfer_n_ref*n_ref_Nt+current_transfer_n_out*current_transfer_n_out*n_out_Nt+current_transfer_p_out*current_transfer_p_out*p_out_Nt)/property_Adc;
    property_Nf=(current_transfer_p_1*current_transfer_p_1*p_1_Nf+current_transfer_p_2*current_transfer_p_2*p_2_Nf+current_transfer_nin_1*current_transfer_nin_1*nin_1_Nf+current_transfer_nin_2*current_transfer_nin_2*nin_2_Nf+current_transfer_n_tail*current_transfer_n_tail*n_tail_Nf+current_transfer_n_ref*current_transfer_n_ref*n_ref_Nf+current_transfer_n_out*current_transfer_n_out*n_out_Nf+current_transfer_p_out*current_transfer_p_out*p_out_Nf)/property_Adc;
    property_fc=property_Nf/property_Nt;
